import React, { Component } from "react";
import { bindActionCreators } from "redux";
import { connect } from "react-redux";
import * as categoryActions from "../redux/actions/categoriesAction";

class SearchComponent extends Component {
  componentDidMount() {
    this.props.actions.displayImages();
  }
  render() {
    return (
      <div>
        <h1> {this.props.images}</h1>
      </div>
    );
  }
}

function mapDispatchToProps(dispatch) {
  return {
    actions: {
        displayImages: bindActionCreators(categoryActions.displayImages, dispatch),
    },
  };
}
export default connect(mapDispatchToProps)(SearchComponent);
